import React from 'react'

var dateTime = () => {
    var showDate = new Date();
    var todaysdate = showDate.getDate() + "-" + showDate.getMonth() + "-" + showDate.getFullYear();

    return (
        <div>
            <input type="text" value={todaysdate} readOnly = "true"/>
        </div>
    )
}

export default dateTime
